import React from "react"
import axios from 'axios'

const Home = () => {


    React.useEffect(() => {
        axios.get('https://api.openweathermap.org/data/2.5/forecast?q=Москва&units=metric&lang=ru&appid=9564702c3543cd18a286664bcd09dcac').then(resp => {
            console.log(resp.data)
        })
    }, [])

    return (
        <div className='main'>
            <div className='container'>
                
            </div>
        </div>
    )
}

export default Home
